import {NavLink} from 'react-router-dom';

function Header() {
    return (
        <div>
            <nav>
                <ul>
                    <li><NavLink exact className="" to="/">Home</NavLink></li>
                </ul>
            </nav>
        </div>
    );
}

export default Header;
